import React from "react";
import "./card.css";

const Card = (props) =>{ //takes properties as props
	return (
		<div id="card_body">
			<img src="https://robohash.org/test?200x200" alt="robots" />

			<div>
				<h2>{props.name}</h2>
				<p>{props.email}</p>
			</div>
		</div>
	);
}


export default Card;
